import React, { Component } from 'react';

class Operations extends Component {
    
deposit=()=>{
    this.props.deposit()
}

    render() {
console.log(this.props.deposit);

        return (
            <div>
                <input placeholder="Amount" value="Amount"></input>
                <input placeholder="Vendor"></input>
                <input placeholder="Category"></input>
                <button multiple={true} value={['B', 'C']} onClick={this.deposit}>Deposit</button>
                <button>Withdraw</button>
            </div>

        )
    }


}


export default Operations
